class Ex12Tests(unittest.TestCase):
    def __init__(self, methodName: str = ...) -> None:
        super().__init__(methodName=methodName)
        self.maxDiff = None

    def assertListEqualWithoutOrder(self, list1, list2, *args, **kwargs):
        self.assertListEqual(sorted(
            list1), sorted(list2), *args, **kwargs)

    def test_is_valid_path(self):
        DEFAULT_BOARD = [
            ["r", "e", "k"],
            ["g", "d", "e"],
            ["n", "pok", "li"]
        ]
        testcases = [
            {
                "name": "no points in path",
                "input": {
                    "board": DEFAULT_BOARD,
                    "path": [],
                    "words": []
                },
                "expected": None
            },
            {
                "name": "single point - cell with two letters",
                "input": {
                    "board": DEFAULT_BOARD,
                    "path": [(2, 2)],
                    "words": ["li"]
                },
                "expected": 'li'
            },
            {
                "name": "multiple points - cell with multiple letters",
                "input": {
                    "board": DEFAULT_BOARD,
                    "path": [(2, 1), (2, 2)],
                    "words": ["pokli"]
                },
                "expected": 'pokli'
            },
            {
                "name": "invalid path - single point which is out of bounds",
                "input": {
                    "board": DEFAULT_BOARD,
                    "path": [(0, 4)],
                    "words": ["dan", "drone", "red"]
                },
                "expected": None
            },
            {
                "name": "happy flow",
                "input": {
                    "board": DEFAULT_BOARD,
                    "path": [(0, 0), (0, 1), (1, 1)],
                    "words": ["dan", "drone", "red"]
                },
                "expected": "red",
            },
            {
                "name": "multiple words matching the path",
                "input": {
                    "board": DEFAULT_BOARD,
                    "path": [(0, 0), (0, 1), (1, 1)],
                    "words": ["dan", "redo", "red"]
                },
                "expected": "red",
            },
            {
                "name": "No words are found",
                "input": {
                    "board": DEFAULT_BOARD,
                    "path": [(0, 0), (0, 1), (1, 1)],
                    "words": ["dan", "drone"]
                },
                "expected": None,
            },
            {
                "name": "Invalid path - duplicates",
                "input": {
                    "board": DEFAULT_BOARD,
                    "path": [(0, 0), (0, 0), (1, 1)],
                    "words": []
                },
                "expected": None,
            },
            {
                "name": "Invalid path - out of bounds",
                "input": {
                    "board": DEFAULT_BOARD,
                    "path": [(0, 0), (0, -1), (1, 1)],
                    "words": []
                },
                "expected": None,
            },
            {
                "name": "words list is empty, path is valid",
                "input": {
                    "board": DEFAULT_BOARD,
                    "path": [(0, 0), (1, 0), (1, 1)],
                    "words": []
                },
                "expected": None,
            },
            {
                "name": "invalid path - big jump",
                "input": {
                    "board": DEFAULT_BOARD,
                    "path": [(0, 0), (2, 0), (1, 1)],
                    "words": ['rnd']
                },
                "expected": None,
            },
            {
                "name": "test log path",
                "input": {
                    "board": DEFAULT_BOARD,
                    "path": [(0, 0), (1, 0), (2, 0), (1, 1), (0, 1), (0, 2), (1, 2), (2, 2), (2, 1)],
                    "words": ['rgndekelipok']
                },
                "expected": 'rgndekelipok',
            },
        ]
        for tc in testcases:
            with self.subTest(tc['name']):
                actual = is_valid_path(**tc["input"])
                self.assertEqual(tc['expected'], actual)

